import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="App">
        <p className="bg-primary">Welcome!! this is home page</p>
        <button color="link" tag={Link} to="/createSlam">
          create new slam
        </button>
      </div>
    );
  }
}

export default Home;
